CREATE TABLE `product_sales_stats` (
  `id` INTEGER(11) NOT NULL AUTO_INCREMENT,
  `product_id` INTEGER(5) NOT NULL,
  `date_sold` DATE DEFAULT NULL,
  `register_id` SMALLINT(8) DEFAULT NULL,
  `shelf_id` SMALLINT(6) DEFAULT NULL,
  `order_type_id` SMALLINT(6) DEFAULT NULL,
  `source_id` SMALLINT(6) DEFAULT NULL,
  `sold_qty` INTEGER(8) DEFAULT NULL,
  `price_unit` DECIMAL(7,2) DEFAULT NULL,
  `transaction_qty` INTEGER(5) DEFAULT NULL,
  `sales_gross` DECIMAL(9,2) DEFAULT NULL,
  `COGS` DECIMAL(8,2) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
)ENGINE=InnoDB
AUTO_INCREMENT=801 AVG_ROW_LENGTH=102 CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';
COMMIT;



